export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},aPwgJ1ybIJ:{data:{id:2015,attributes:{imdbId:"tt3332064",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzk2MDg5MDczMl5BMl5BanBnXkFtZTgwNTE2NjYyNjE@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Rotten Tomatoes",Value:"27%"},{Source:"Metacritic",Value:"36\u002F100"}],item_lang:{data:{id:2678,attributes:{title:"Pan",plot:"An orphan boy (Levi Miller) discovers his destiny as Peter Pan in this vividly realized fantasy, and is whisked away to an enchanted land to battle the fearsome pirate Blackbeard (Hugh Jackman) with the help of the warrior woman Tiger Lily (Rooney Mara)..",slug:"pan"}}},books:{data:[{id:10041,attributes:{title:"Peter Pan (Peter and Wendy)",description:"Peter Pan is a mischievous boy who decided he would never grow up. When he convinces Wendy Darling and her brothers to fly away with him, they travel to the island of Neverland in an enchanted world where adventures await around every corner. But when nefarious pirate Captain Hook captures Wendy and the boys, will Peter and the fairy Tinker Bell be able to save them? First published in 1911 with illustrations by F. D. Bedford, this is an unabridged version of Scottish author and playwright J. M. Barrie's iconic fantasy for children—and children at heart.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AkqMCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:true,published:"2015-08-01",publisher:"First Avenue Editions",subtitle:a}},{id:10042,attributes:{title:g,description:"J.M. Barrie's classic tale of the \"boy who would not grow up\" Peter Pan originally appeared as a baby living a magical life among birds and fairies in J.M. Barrie’s sequence of stories, Peter Pan in Kensington Gardens. His later role as flying boy hero was brought to the stage by Barrie in the beloved play Peter Pan, which opened in 1904 and became the novelPeter and Wendy in 1911. In a narrative filled with vivid characters, epic battles, pirates, fairies, and fantastic imagination, Peter Pan’s adventures capture the spirit of childhood—and of rebellion against the role of adulthood in conventional society. This edition includes the novel and the stories, as well as an introduction by eminent scholar Jack Zipes. Looking at the man behind Peter Pan and sifting through the psychological interpretations that have engaged many a critic, Zipes explores the larger cultural and literary contexts in which we should appreciate Barrie’s enduring creation and shows why Peter Pan is a work not for children but for adults seeking to reconnect with their own imagination. For more than seventy years, Penguin has been the leading publisher of classic literature in the English-speaking world. With more than 1,700 titles, Penguin Classics represents a global bookshelf of the best works throughout history and across genres and disciplines. Readers trust the series to provide authoritative texts enhanced by introductions and notes by distinguished scholars and contemporary authors, as well as up-to-date translations by award-winning translators.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Om4YAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2004-07-27",publisher:"Penguin",subtitle:"Peter and Wendy and Peter Pan in Kensington Gardens"}},{id:10043,attributes:{title:g,description:"Peter Pan is a character created by Scottish novelist and playwright J. M. Barrie. A mischievous boy who can fly and never grows up, Peter Pan spends his never-ending childhood adventuring on the small island of Neverland as the leader of his gang, the Lost Boys, interacting with mermaids, Native Americans, fairies, pirates, and occasionally ordinary children from the world outside of Neverland. In addition to two distinct works by Barrie, the character has been featured in a variety of media and merchandise, both adapting and expanding on Barrie's works.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=o414oAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2014-07-13",publisher:h,subtitle:a}},{id:10044,attributes:{title:"IMAGE DE L'EDITEUR PETER PAN.",description:a,thumbnail:a,authors:["SIR J. M. BARRIE"],firstBook:d,published:"2017-01-01",publisher:a,subtitle:a}},{id:10045,attributes:{title:"The Adventures of Peter Pan",description:"Peter Pan is the timeless classic everyone has grown up to. It has been passed down from generation to generation but it all started with one man, J. M. Barrie. Barrie made sure that this story would be appropriate for all ages. Some of the language might be a bit difficult for the youngest range but the context helps to figure out a funny word or two. It appeals to the older range because of the layers it conceals. Behind each game they play is a message. Hidden under each smile Wendy gives to Peter is her hidden kiss. However, this story relates mostly to teenagers as they are going through the stage of growing up. The Disney movies about Peter Pan have tried hard to incorporate everything from the book, but they didn't get every meaning or all the symbolism. For example, Mrs. Darling and Wendy Darling both have a hidden kiss. This kiss is hidden under the right hand corner of their mouths and only their true love can find it. Because Mr. Darling can't find Mrs. Darling's kiss, perhaps Barrie is trying to say that although she loves Mr. Darling dearly, he isn't her true love. Barrie fills his book with the perfect amount of detail. Children don't get bored because there is too much and adults don't need any more. At one point in the story, Barrie writes about the adventures at the lagoon. \"If you shut your eyes and are a lucky one, you may see at times a shapeless pool of lovely pale colors suspended in the darkness; then if you squeeze your eyes tighter, the pool begins to take shape, and the colors become so vivid that with another squeeze they must go on fire.\" It is work like this that captures the reader and makes them never put the book down. The action and the drama are another reason such a wide age range is attached to this story. The lost boys go on countless raids and enticing adventures that children can only dream about. The love story between Peter and Wendy thickens throughout the entire book and we don't know till the end whether the Darlings will return home to England or stay in Neverland forever. Barrie does an incredible job with the characters. John and Michael are as adorable as ever, Captain Hook as evil, Tinkerbell as envious, Peter as cocky and Wendy as in love. Though the title expresses that the story is about Peter Pan, one of Barrie's hidden messages was that it was really Wendy's story. Peter Pan can meet many more pirates and have many more adventures but Wendy only had that one time with him. She could only be his mother, or possibly his only love, once in her life. She was supposed to go back to Neverland every spring to do Peter's spring cleaning but he forgot almost every year. Barrie might have been trying to show how forgetful little boys are. He also might have been trying to show Peter's denial that Wendy might grow up. If Peter didn't go back then Wendy might not grow up. If he didn't go back he wouldn't be reminded that he lost the love of his life. Barrie did a phenomenal job with this story. His ideas make you wonder why growing up is necessary and why none of us have ever been able to see Tink's glow, outside of our dreams. This book is suitable for all ages: the only thing that could make it even better were if we could be in the story ourselves.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Xbk4lAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2012-12-20",publisher:h,subtitle:a}}]}}},meta:{}}},prerenderedAt:1682568420816}}("","movie","J. M. Barrie",null,"series",1,"Peter Pan","Createspace Independent Pub"))